Mongoose not fetching data until I refresh the database connection<p>I am trying to re-fetch the data from MongoDB using mongoose whenever a user reloads the page. However, the old data stays there and the new data doesn't get fetched until I restart the server.</p>

<p>Here is the router:</p>

<pre><code>router.post("/dashboard", (req, res) =&gt; {
  const userId = req.body.userId;
  User.findOne({ _id: userId }, (err, users) =&gt; {
    if (err) {
      console.log(err);
      res.status(500).send();
    } else {
      router.get("/dashboard", (req, res, next) =&gt; {
        const leagues = [users.leagues.premium, users.leagues.free];
        if (err) return next(err);
        res.status(200).send(leagues);
      });
    }
  });
}); 
</code></pre>

<p>And here is the Actions (Redux): </p>

<pre><code>export const fetchLeagues = userId =&gt; dispatch =&gt; {
  axios.post("/api/leagues/dashboard", userId).then(
    setTimeout(function() {
      axios.get("/api/leagues/dashboard").then(leagues =&gt; {
        dispatch({
          type: GET_LEAGUES,
          payload: leagues
        });
      });
    }, 50)
  );
};
</code></pre>

<p>The data must be fetched from a specific user, so that's why I am posting the user Id,  then getting the data back. Not sure if this is the best way of doing this.</p>

<p>Just to clarify, I am using the MERN stack with redux and axios to execute this. I tried to use this: <a href="https://stackoverflow.com/questions/41660638/mongodb-does-not-refresh-data-automatically">MongoDB does not refresh data automatically?</a>, but I still can't get this thing to refresh/re-fetch the data when the router is called again. Thanks.</p>

