Is there a way to save ParseObject without make a HTTP request to the REST API?<p>I didn't find very much about this topic, so I wonder if it is an easy task to achieve or if it's actually not possible. My problem is that I have a lot of HTTP requests on my server even if a Cloud function is called only once. So I suppose that all the object updating / savings / queries are made by using the REST API. I have so many HTTP requests that several hundred are going timeout, I suppose for the huge traffic that it's generated.</p>

<p>Is there a way to save a ParseObject by executing the query directly to MongoDB? If it's not possible at the moment can you give me some hints if there are already some helper functions to convert a ParseQuery and a ParseObject to the relative in MongoDB so that I can use the MongoDB driver directly?</p>

<p>It's really important for my application to reduce HTTP requests traffic at the moment.</p>

<p>Any idea? Thanks!</p>

<p>EDIT:
Here an example to reproduce the concept:</p>

<p>Make a cloud function:</p>

<pre><code>Parse.Cloud.define('hello', async (req, res) =&gt; {
  let testClassObject = new Parse.Object('TestClass');

  await testClassObject.save(null, {useMasterKey: true});

  let query = new Parse.Query('TestClass');

  let testClassRecords = await query.find({useMasterKey: true});

  return testClassRecords;
});

</code></pre>

<p>Make a POST request:
POST <a href="http://localhost:1337/parse/functions/hello" rel="nofollow noreferrer">http://localhost:1337/parse/functions/hello</a></p>

<p>Capture HTTP traffic on port 1337 using Wireshark:
<a href="https://i.stack.imgur.com/bJksV.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/bJksV.png" alt="enter image description here"></a></p>

<p>You can see that for 1 POST request other 2 are made because of the saving / query code. My goal would be to avoid these two HTTP calls and instead make a DB call directly so that less traffic will go through the whole webserver stack.</p>

<p>Link to the Github question: <a href="https://github.com/parse-community/parse-server/issues/6549" rel="nofollow noreferrer">https://github.com/parse-community/parse-server/issues/6549</a></p>

