Create an In filter against an array field of Mongodb using c#<p>I have an object similar to the one below in C#. I would like to find matching person objects that contain an item matching a provided <code>type</code> and that item's <code>sourceId</code> is also present in an array of provided <code>sourceIds</code>:</p>

<pre><code>Person: {
  id: 1,
  items: [
    {
      type: "one",
      sourceId: 2
    },
    {
      type: "two"
      sourceId: 3
    }
  ]
}
</code></pre>

<p>So far I have come up with this:</p>

<pre><code>var filter = Builders&lt;Person&gt;.Filter.In(p =&gt; p.items.Where(i =&gt; i.type == "one").FirstOrDefault().sourceId, providedIds);
var results = PersonCollection.FindAsync(filter);
